SharedConfig.BuyableVehicles = {};

SharedConfig.VehicleNames = {};
SharedConfig.VehiclePrices = {};

for i,v in ipairs(SharedConfig.Vehicles) do 
    if (not v.ignore) then
        table.insert(SharedConfig.BuyableVehicles, v);
    end

    SharedConfig.VehicleNames[v.model] = v.manufacturer .. ' ' .. v.name;
    if (GetHashKey) then 
        SharedConfig.VehicleNames[GetHashKey(v.model)] = v.manufacturer .. ' ' .. v.name;
    end 

    SharedConfig.VehiclePrices[v.model] = v.price;
    if (GetHashKey) then 
        SharedConfig.VehiclePrices[GetHashKey(v.model)] = v.price;
    end 
end 

function getVehicleName(modelOrHash)
    if (type(modelOrHash) == 'string' and GetHashKey) then 
        return SharedConfig.VehicleNames[GetHashKey(modelOrHash)];
    elseif (type(modelOrHash) == 'number') then 
        return SharedConfig.VehicleNames[modelOrHash];
    end 

    return 'NULL';
end 

function getVehiclePrice(modelOrHash)
    if (type(modelOrHash) == 'string' and GetHashKey) then 
        return SharedConfig.VehicleNames[GetHashKey(modelOrHash)];
    elseif (type(modelOrHash) == 'number') then 
        return SharedConfig.VehicleNames[modelOrHash];
    end 

    return 25000;
end 

function getVehicleList()
	return SharedConfig.Vehicles;
end 

exports('getVehicleList', getVehicleList);
exports('getVehicleName', getVehicleName);
exports('getVehiclePrice', getVehiclePrice);